import React, {Component} from "react"

class DashBoard extends Component{
    state={
        loading: false,
        tution: []
    }   

    componentDidMount(){
        this.setState({loading: true})
        fetch("http://localhost:4000/dashboard")
            .then(response => response.json()) 
            .then(data => { 
                this.setState({
                    loading: false,
                    tution : data
                })
                console.log(data)
            })
    }
    
    
    render(){
       
        return(
            
            <div>

        <ul>{this.state.tution.map(element => {
        
        return <li key={element.tution_id} >{element.studentname}</li>
        })}</ul>
            </div>
        )
    }
}


export default DashBoard
